                    <div class='tn-atom' field='tn_text_1594310809704'>Коррекция веса однозначно повлияла на все аспекты жизни: прошла боль в спине, улучшилось общее самочувствие, появилось больше энергии. Повысилась уверенность в себе, хочется чаще смотреться в зеркало. Походка стала ровнее, спина выпрямилась. Появились новые спортивные цели, которые с радостью достигались. <br></div>
