                    <div class='tn-atom' field='tn_text_1594388489489'><span style="font-weight: 600;">Влияние на состояние здоровья:</span> стал намного выносливее, могу гулять часами, стал полон энергии каждый день, меньше времени надо организму чтобы отдохнуть во время сна.<br><br><span style="font-weight: 600;">Психология: <strong></strong></span>стал чувствовать себя более уверено. Стал постить больше фото в инстаграм, стал увереннее чувствовать себя на камеру что привело к росту подписичков в инстаграм. <br><br><strong>Бизнес:</strong> стал более продуктивным в бизнесе, стал делать больше задач и при этом меньше уставать, что привело к росту дохода, увереннее общаюсь с людьми, в бизнес переговорах.<br></div>
