                <div class='t396__elem tn-elem tn-elem__2116380391594388903193' data-elem-id='1594388903193' data-elem-type='text' data-field-top-value="471" data-field-top-res-960-value="522" data-field-top-res-640-value="2144" data-field-top-res-480-value="2234" data-field-top-res-320-value="2333" data-field-left-value="81" data-field-left-res-960-value="10" data-field-left-res-640-value="50" data-field-left-res-480-value="10" data-field-left-res-320-value="10" data-field-width-value="630" data-field-width-res-960-value="510" data-field-width-res-640-value="540" data-field-width-res-480-value="460" data-field-width-res-320-value="300" data-field-axisy-value="top" data-field-axisx-value="left" data-field-container-value="grid" data-field-topunits-value="" data-field-leftunits-value="" data-field-heightunits-value="" data-field-widthunits-value="">
                    <div class='tn-atom' field='tn_text_1594388903193'><span style="font-weight: 600;">Состояние здоровья: </span>добавилось энергии, простудные болезни без температуры, менее болезненные менструальные дни. Появилась выносливость и меньше стала уставать от активной работы. <br><span style="font-weight: 600;">Психологически:</span> стала больше понимать и любить своё тело, повысилась самооценка, чаще стала слышать комплименты и вопросы о работе над телом. <br><span style="font-weight: 600;">Отношения:</span> Сперва было сложно, но после того, как муж оценил результат, понял, что необходимо отпускать на тренировки и помогать с ребёнком в это время. Общие интересы с мужем. <br></div>
                </div>
                <div class='t396__elem tn-elem tn-elem__2116380391594388903368' data-elem-id='1594388903368' data-elem-type='text' data-field-top-value="692" data-field-top-res-960-value="795" data-field-top-res-640-value="2393" data-field-top-res-480-value="2535" data-field-top-res-320-value="2764" data-field-left-value="81" data-field-left-res-960-value="10" data-field-left-res-640-value="50" data-field-left-res-480-value="10" data-field-left-res-320-value="10" data-field-width-value="630" data-field-width-res-960-value="500" data-field-width-res-640-value="540" data-field-width-res-480-value="460" data-field-width-res-320-value="300" data-field-axisy-value="top" data-field-axisx-value="left" data-field-container-value="grid" data-field-topunits-value="" data-field-leftunits-value="" data-field-heightunits-value="" data-field-widthunits-value="">
                    <div class='tn-atom' field='tn_text_1594388903368'>Когда тело приобретает подтянутый вид, даже отсутствие тренировок некоторое время не сильно портит фигуру, но только при правильном питании. А питание и регулярный спорт дают хороший результат. Но питание должно быть правильным, а тренировки регулярными. Также спорт становится стилем жизни. И уже везде хочется активности и ищешь возможности.</div>
                </div>
