                    <div class='tn-atom' field='tn_text_1594898811087'><span style="font-weight: 600;">Влияние на состояние здоровья:</span> ушла одышка, нормализовалось давление. <br><span style="font-weight: 600;">Самочувствие:</span> стал более бодр и работоспособен, легче переношу длительные нагрузки. <br><span style="font-weight: 600;">Отношения:</span> жена смеётся, что любила меня и толстым, так что никак не повлияло :) <br><span style="font-weight: 600;">Психология:</span> стал более уверенным, ушло стеснение своего тела, могу нормально подобрать одежду по размеру. Причём можно сказать, что не только в бытовом плане, но и в профессиональном, как-то стал себя выше оценивать. <br></div>
