                                <div class="t849__textwrapper">
                                    <div class="t849__text t-descr t-descr_sm" field="li_descr__1531218700960" style="font-weight:500;font-family:'Circle';">Наш курс не ущемляет вас в питании. Не заставляет потреблять,то что вы не едите. Не обременяет готовить определённые блюда и только их.Ты сам/сама выбираешь, что из продуктов питания тебе подходит. Мы заменим ненужные и бесполезные продукты для твоего организма, выработаем правильные привычки в питании и активности.<br></div>
